css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document regexp("https?:\/\/(docs\.spring\.io\/spring\/docs\/current\/spring-framework-reference\/.*)") {
  
  body{
    background-color: #484848;
    color: #E8E8E8;
  }
  
  body.firstpage {
    background-image: none;
    background-color: #484848;
  }  
  
  h1, h2, h3, h4, h5, h6{
    color: #E8E8E8;
  }
  
  pre{
    color: #F0F0F0;
  }
  
  :not(pre) > code{
    background-color: #C0C0C0;
    border-color: #383838;
  }
  
  div.important p, div.note p, div.tip p, div.warning p {
	color: #D0D0D0;
  }
  
  a{
    color:#5BB7E5;
  }
  
  pre.programlisting, pre.screen{
    color: #282828;
  }
  
  td, th{
    color: #282828;
  }
  
  .navheader th, .navfooter td{
    color: #E8E8E8;
  }
  
  code.literal{
    background: #E8E8E8;
  }
  
  tbody{
    background-color: #909090;
  }
  
  .sidebar p{
    color: #282828;
  }

}
